import './App.css';
import API from './API';
import { useEffect, useState } from 'react';

function App() {
  useEffect(() => {
    API.authenticate()
      .then(resp => resp.json())
      .then(data => console.log(data));
  });

  return <div className="App"></div>;
}

export default App;
